import axios from 'axios';
import React, { useEffect } from 'react'
import { useParams } from 'react-router-dom';

export default function DetailPage() {
    const [post, setPost] = useState([]);
    const {id} = useParams();

  useEffect(() => {
    axios.get("http://localhost:3030/" + id).then((data) => {
      console.log(data);
      setPost(data?.data);
    });
  }, []);
  return (
    <div>{post.title}</div>
  )
}

